import React, { useRef } from 'react'
import { useLoader, useFrame } from 'react-three-fiber'
import { GLTFLoader } from 'three/examples/jsm/loaders/GLTFLoader'
import * as THREE from 'three'

export const Map = () => {

  const { nodes, materials } = useLoader(GLTFLoader, '/try.gltf')

  const mapRef = useRef();
  const mapDummyPosition = new THREE.Vector3(0, -0.8, 0);
  const mapDummyRotation = new THREE.Quaternion(0, -Math.PI, 0, 0);
  const mapDummyScale = new THREE.Vector3(1, 1, 1);

  useFrame(() => {
    // Target cametra during the arrival: follows Kjell + slow move towards map
    mapRef.current.position.lerp(mapDummyPosition, 0.0175);
    mapRef.current.scale.lerp(mapDummyScale, 0.015);
    if (mapRef.current.position.x >= -2500) {
      mapRef.current.quaternion.slerp(mapDummyRotation, 0.0002);
    }
  });

  return (
    <group ref={mapRef} dispose={null}>
      <group position={[-7.76, 3.76, -13.82]} rotation={[-0.26, -0.95, 0.62]} scale={[0.29, 0.29, 0.29]}>
        <mesh castShadow material={materials.Material_Leaves_0} geometry={nodes.Icosphere012.geometry} />
        <mesh castShadow material={materials.Material_Leaves_Dark_0} geometry={nodes.Icosphere012_1.geometry} />
        <mesh castShadow material={materials.Material_Wood} geometry={nodes.Icosphere012_2.geometry} />
      </group>
      <mesh
      castShadow 
        material={materials.Material_Leaves_0}
        geometry={nodes.Icosphere008.geometry}
        position={[-5.45, 0.09, -12.32]}
        rotation={[-0.61, 0.39, 0.91]}
        scale={[0.36, 0.36, 0.36]}
      />
      <mesh
        castShadow 
        material={materials.Material_Leaves_1}
        geometry={nodes.Icosphere007.geometry}
        position={[-5.45, 0.24, -12.32]}
        rotation={[-0.61, 0.39, 0.91]}
